svg.script:
// Get the bit of the URL you need
// This will include locations such as toilets if declared
// e.g. http://www.sussex.ac.uk/library/floorplans/second_floor.svg?showLocation=toilets

var split_it_up = window.location.search.split("=");

var classmark = split_it_up[1];

// Unhide the appropriate information boxes and markers based on classmark

if (classmark == 'a') {

        document.getElementById("a_classmark").style.visibility = "visible";
        document.getElementById("a-pin").style.visibility = "visible";
        document.getElementById("ad_mask").style.visibility = "visible";
		document.getElementById("A-D-TEXT").style.visibility = "hidden";
}
else if (classmark == 'b') {

        document.getElementById("b_classmark").style.visibility = "visible";
        document.getElementById("b-pin").style.visibility = "visible";
		document.getElementById("ad_mask").style.visibility = "visible";
		document.getElementById("A-D-TEXT").style.visibility = "hidden";

}

else if (classmark == 'c') {

        document.getElementById("c_classmark").style.visibility = "visible";
        document.getElementById("c-pin").style.visibility = "visible";
        document.getElementById("ad_mask").style.visibility = "visible";
		document.getElementById("A-D-TEXT").style.visibility = "hidden";

}


else if (classmark == 'd') {
//else if (classmark.match(/d-df/g)) {

        document.getElementById("d_classmark").style.visibility = "visible";
        document.getElementById("d-pin").style.visibility = "visible";
        document.getElementById("ad_mask").style.visibility = "visible";
		document.getElementById("A-D-TEXT").style.visibility = "hidden";

}

// Do we need to show the toilets?
if (classmark == 'toilets') {
        document.getElementById("toilets").style.visibility = "visible";
}

// Do we need to show the training room?

if (classmark == 'training_room') {
        document.getElementById("rectTrain").style.visibility = "visible";
		document.getElementById("training_room").style.visibility = "visible";
		document.getElementById("training_room_infotext").style.visibility = "visible";
		document.getElementById("training_room_infotext2").style.visibility = "visible";
}
